  const [inforTeam,setInforTeam]= useState(OurTeam);
  useEffect(() => {
    return () => {
      console.log('clearn ok')
    }
  },[inforTeam])
  return (
    <div>
    <Grid container spacing={3}>            
      {inforTeam.map((infor) => (<Grid item sm={3} xs={6}><OneCard key={infor.name} inforTeam={inforTeam} setInforTeam={setInforTeam} infor={infor}/></Grid>))}
    </Grid>
    </div>
  )
}
